import React from 'react';
import './App.css';
import sky from './images/birthday-sky.jpg'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>A long time ago, in a galaxy far, far away...</h1>
        <img src={sky} className="App-logo" alt="logo" />
        <figcaption>Galaxy Cluster Abell 1689, Shot by Hubble Space Telescope, on July 7, 2010</figcaption>
      </header>
    </div>
  );
}

export default App;
